import React from 'react';
import './VehiclesDetails.css';

const carData = {
  sedans: [
    { name: "Kia Forte", engine: "2.0L 4-cylinder", image: "path/to/kia_forte.jpg" },
    { name: "Toyota Yaris", engine: "1.5L 4-cylinder", image: "path/to/toyota_yaris.jpg" },
    { name: "Ford Focus", engine: "2.0L 4-cylinder", image: "path/to/ford_focus.jpg" },
    // Add more sedans...
  ],
  suvs: [
    { name: "Mitsubishi Pajero IO", engine: "3.0L V6", image: "path/to/pajero_io.jpg" },
    { name: "Subaru Forester", engine: "2.5L 4-cylinder", image: "path/to/subaru_forester.jpg" },
    { name: "Honda CR-V", engine: "2.4L 4-cylinder", image: "path/to/honda_crv.jpg" },
    // Add more SUVs...
  ],
  sports: [
    { name: "Mercedes SLK 230", engine: "2.3L 4-cylinder", image: "path/to/mercedes_slk.jpg" },
    { name: "Ford Mustang", engine: "5.0L V8", image: "path/to/ford_mustang.jpg" },
    // Add more sports cars...
  ],
  seater7: [
    { name: "Toyota Sienna", engine: "3.5L V6", image: "path/to/toyota_sienna.jpg" },
    { name: "Ford Explorer", engine: "2.3L 4-cylinder", image: "path/to/ford_explorer.jpg" },
    // Add more 7-seaters...
  ],
};

const CarCard = ({ name, engine, image }) => {
  return (
    <div className="car-card">
      <img src={image} alt={name} className="car-image" />
      <h3 className="car-name">{name}</h3>
      <p className="car-engine">Engine: {engine}</p>
      <button className="free-button">Free Cancellation</button>
      <button className="insurance-button">Free Insurance</button>
    </div>
  );
};

const VehiclesDetails = () => {
  return (
    <div className="vehicles-details">
      <h1>Available Vehicles</h1>

      {Object.entries(carData).map(([type, cars]) => (
        <section key={type}>
          <h2 className="car-type">{type.charAt(0).toUpperCase() + type.slice(1)}</h2>
          <div className="car-grid">
            {cars.map((car, index) => (
              <CarCard
                key={index}
                name={car.name}
                engine={car.engine}
                image={car.image}
              />
            ))}
          </div>
        </section>
      ))}
    </div>
  );
};

export default VehiclesDetails;
